package app.main.searchimport androidx.compose.material.icons.Iconsimport androidx.compose.material.icons.filled.Searchimport androidx.compose.runtime.Composableimport androidx.compose.runtime.rememberimport androidx.compose.ui.graphics.vector.rememberVectorPainterimport cafe.adriel.voyager.navigator.tab.Tabimport cafe.adriel.voyager.navigator.tab.TabOptionsobject SearchTab : Tab {	@Composable	override fun Content() {		SearchContent()	}	override val options: TabOptions		@Composable		get() {			val title = "Search"			val icon = rememberVectorPainter(				Icons.Default.Search			)			return remember {				TabOptions(					index = 1u,					title = title,					icon = icon				)			}		}}